var width = 0;
var height = 0;

var video = null;
var canvas = null;
var startbutton = null;
var autoscan = false;
var autoscan_running = false;
var stop_autorun = false;

function startup() {
    video = document.getElementById('video');
    canvas = document.getElementById('canvas');
    startbutton = document.getElementById('startbutton');
    navigator.mediaDevices.getUserMedia({
        video: {
            width: {
                ideal: 1280,
            },
            height: {
                ideal: 720,
            },
            facingMode: {
                ideal: "environment",
            },
        },
        audio: false
    })
        .then(function (stream) {
            video.srcObject = stream;
            video.play();
        })
        .catch(function (err) {
            console.log("An error occurred: " + err);
        });


}

const beep = new Audio("data:audio/wav;base64,");

function buttonpress() {
    if (autoscan && autoscan_running) {
        stop_autorun = true;
    } else {
        takepicture();
    }
}

function takepicture() {
    if (stop_autorun) {
        autoscan_running = false;
        stop_autorun = false;
        document.getElementById('tts').src = "/img/autostart.png";
        return;
    }

    if (!autoscan) {
        beep.play();
    }

    var context = canvas.getContext('2d');
    canvas.width = video.videoWidth;
    canvas.height = video.videoHeight;
    context.drawImage(video, 0, 0, video.videoWidth, video.videoHeight);
    var data = canvas.toDataURL('image/png');
    const suc_beep = new Audio("data:audio/wav;base64,");
    const err_beep = new Audio("data:audio/wav;base64,");

    $.ajax({
        url: "/scan",
        data: data,
        type: 'POST',
        dataType: 'json',
        success: function (res) {
            show_alert(res);
            suc_beep.play();
            if (autoscan) {
                autoscan_running = true;
                document.getElementById('tts').src = "/img/autostop.png";
                setTimeout(takepicture, 2000);
            }
        },
        error: function (res) {
            if (!autoscan) {
                show_alert(res.responseJSON);
                err_beep.play();
            } else {
                autoscan_running = true;
                document.getElementById('tts').src = "/img/autostop.png";
                setTimeout(takepicture, 100);
            }
        }
    });
}

function show_alert(data) {
    document.getElementById('alert_box').innerHTML += data['content'];
    setTimeout(function () {
        $("#alert_" + data['uuid']).alert('close');
    }, 2000);
}

window.addEventListener('load', startup, false);